    useEffect(()=>{
        fetchData();
    })

    async function fetchData(){
        const getData = await fetch("https://raw.githubusercontent.com/UncleJerry23/steven-universe-graphql-api/master/lib/utils/charactersSeeds/charactersFixed.json")
        console.log(getData);
    }





    return (
    <>
